import React from 'react';

import { RiMenu3Line, RiCloseLine } from 'react-icons/ri';
import logo from '../../assets/logo.svg';
import './navbar.css';

// BEM -> Block Element Modifier
const Navbar = () => {
  return (
    <div className="web__navbar">
      <div className='web__navbar-links'>

        <div className='web__navbar-links_logo'>
          <img src={logo} alt="Logo" /> {/* Fixed the unclosed string and self-closed img tag */}
        </div>
        <div className='web__navbar-links_container'>
          <p><a href='#home'>Home</a></p>
          <p><a href='#wweb'>What is Web</a></p>
          <p><a href='#possibility'>Open AI</a></p>
          <p><a href='#featueres'>Case Studies</a></p>
          <p><a href='#blog'>Library</a></p>
        </div>
      </div>

      <div className='web__navbar-sign'>
          <p>Sign in</p>
          <button type='button'>Sign up</button>
      </div>





    </div>
  )
}

export default Navbar;
